import React, { useState } from 'react'
import axios from 'axios'
const Main = () => {
  var data = ''

  var config = {
    method: 'get',
    url: 'https://secure.splitwise.com/api/v3.0/get_current_user',
    headers: {
      Authorization: 'Bearer 3nEEKOhKOAqNBZ0ybgjHXTuCpy5EgANNyOL48CKg',
    },
    data: data,
  }

  axios(config)
    .then(function (response) {
      console.log(response)
    })
    .catch(function (error) {
      console.log(error)
    })

  return <div>{data}</div>
}

export default Main
